css:
@-moz-document domain(www.baidu.com) {
  #s-hotsearch-wrapper,
  #s_top_wrap,
  #s-top-left,
  #u1 {
    display: none;
  }

  #wrapper:not(.wrapper_l) #head_wrapper {
    margin-top: 15vh;
  }

  #content_right table {
    display: none;
  }

  #content_left > div {
    display: none;
  }

  #content_left > div[class] {
    display: block;
  }

  #container.sam_newgrid.container_l {
    width: 93.5vw;
    padding-left: 65px;
  }

  #searchTag > div {
    width: 93.5vw;
    left: 0;
  }

  #head .head_wrapper {
    margin-bottom: 0px;
    width: 90vw;
  }
  
  .wrapper_new #s_tab.s_tab .s_tab_inner {
    padding-left: 0;
    width: 93.5vw;
  }
}
